import logo from './logo.svg';
import './App.css';

const document = [
  "/h1 Parchment v0",
  "Let's see if this works",
]

function App() {
  return (
    <div className="App">
      {
        document.map(line => {
          return display(line)
        })
      }
    </div>
  );
}

const display = (line) => {
  if(line.split(" ")[0] = '/h1') {
    <h1>{ line }</h1>
  } else {
    <p>{ line }</p>
  }
}

export default App;
